import { loadAllCategoriesAction } from "../reducers/categoriesReducer"

export const getAllCategories = callback => {
    fetch('http://localhost:3333/categories/all')
    .then(res => res.json())
    .then(json => callback(loadAllCategoriesAction(json)))
}
